import './App.css';
import React from 'react';
import { Container, Row, Col, Table, Navbar } from 'reactstrap';
import Nav_bar from './components/Nav_bar';
import Table_View from './components/Table_View';
import Button_UpdateAll from './components/button_updateall';
import Output from './components/Output';
import DataTableExample from './components/DataTableExample';
import Extable from './components/extable';
// import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div>
      {
        <>
          <Nav_bar></Nav_bar>
          <div class="container-fluid">
            <div class="row">
              <div class="col">
              </div>
              <div class="col">
              </div>
              <div class="col">
                <div class="d-grid gap-2 d-md-flex justify-content-md-end">
                  <a href="http://localhost:3000/" type="button" class="btn btn-danger">
                    Refresh Page
                  </a><br />
                  <Button_UpdateAll></Button_UpdateAll>
                </div>
              </div>
            </div>

            <div class="row">
              <div class="col">
                <div>
                  <nav aria-label="breadcrumb">
                    <ol class="breadcrumb">
                      <li class="breadcrumb-item active" aria-current="page"></li>
                    </ol>
                  </nav>
                </div>
              </div>
              <div class="col">
                {/* Column2 Row2 */}
              </div>
            </div>
            <div class="row">
              <div class="col-12">
                <DataTableExample></DataTableExample>
              </div>
              {/* <div class="col-5">
                  <Output></Output>
                </div> */}
            </div>
          </div>
        </>
      }
    </div>
  );
}

export default App;
